                    yearList: (() => {
                        let r = [];
                        for (let i = 1970; i <= 2025; i++) {
                            r.push({ code: "" + i, name: "" + i });
                        }
                        return r;
                    })(),
                    monthList: (() => {
                        let r = [];
                        for (let i = 1; i <= 12; i++) {
                            r.push({ code: "" + i, name: "" + i });
                        }
                        return r;
                    })(),
                    dayList: (() => {
                        let r = [];
                        for (let i = 1; i <= 31; i++) {
                            r.push({ code: "" + i, name: "" + i });
                        }
                        return r;
                    })(),
                    sexList: [{ code: "0", name: "女" }, { code: "1", name: "男" }],
                    form: {
                        code: null,
                        year: null,
                        month: null,
                        day: null,
                        sex: null,
                        shape: null,
                        last1: null,
                        last4Sum: null,
                    },
                    result: [],
                }
            },
            mounted() {

            },
            methods: {
                gen() {
                    console.log(this.form);
                    if (!this.form.code || !this.form.year || !this.form.month || !this.form.day || !this.form.sex) {
                        alert("清输入信息");
                        return;
                    }
                    this.result = [];
                    for (let i = 0; i < 1000; i++) {
                        if ("" + (i % 2) != this.form.sex) {
                            continue;
                        }
                        let idCardPre = this.form.code + this.addZero(this.form.year, 4) + this.addZero(this.form.month, 2) + this.addZero(this.form.day, 2) + this.addZero(i, 3);
                        let idCard = idCardPre + this.genVerifyCode(idCardPre);
                        if (this.form.shape) {
                            let shapeArr = [];
                            let tArr = [];
                            let t = idCard.substring(14, 18);
                            for (let i = 0; i < 4; i++) {
                                let sn = Number(this.form.shape[i]);
                                let tn = t[i] == "X" ? 10 : Number(t[i]);
                                shapeArr.push({ v: sn, i });
                                tArr.push({ v: tn, i });
                            }
                            shapeArr.sort((a, b) => {
                                if (a.v != b.v) {
                                    return a.v - b.v;
                                } else {
                                    return a.i - b.i;
                                }
                            });
                            tArr.sort((a, b) => {
                                if (a.v != b.v) {
                                    return a.v - b.v;
                                } else {
                                    return a.i - b.i;
                                }
                            });
                            let v = true;
                            for (let i = 0; i < 4; i++) {
                                if (shapeArr[i].i != tArr[i].i || i > 0 && !(
                                    shapeArr[i].v == shapeArr[i - 1].v && tArr[i].v == tArr[i - 1].v
                                    || shapeArr[i].v > shapeArr[i - 1].v && tArr[i].v > tArr[i - 1].v
                                    || shapeArr[i].v < shapeArr[i - 1].v && tArr[i].v < tArr[i - 1].v
                                )) {
                                    v = false;
                                    break;
                                }
                            }
                            if (!v) {
                                continue;
                            }
                        }
                        if (this.form.last1) {
                            if (this.form.last1 != idCard[17]) {
                                continue;
                            }
                        }
                        if (this.form.last4Sum) {
                            let t = idCard.substring(14, 18);
                            let s = 0;
                            for (let i = 0; i <= 3; i++) {
                                let tn = t[i] == "X" ? 10 : Number(t[i]);
                                s += tn;
                            }
                            if (Number(this.form.last4Sum) != s) {
                                continue;
                            }
                        }
                        this.result.push({ idCard: idCard });
                    }

                },
                addZero(num, len) {
                    let r = Number(num) + 1000000 + "";
                    return r.substring(r.length - len, r.length);
                },
                genVerifyCode(idCardPre) {
                    const w = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2];
                    const v = ["1", "0", "X", "9", "8", "7", "6", "5", "4", "3", "2"];
                    let sum = 0;
                    for (let i in idCardPre) {
                        sum += w[i] * Number(idCardPre[i]);
                    }
                    return v[sum % 11];
                }
            }
        });
        app.use(ElementPlus);
        app.mount("#app");
    </script>
